text:
@awanasgh @sruotolo1 No, è che sono paraculi. 

La richiesta è "avete sostenuto che ho fatto attività X e Y e ho preso dei soldi. Fatemi vedere i documenti (della PA) che mi incriminerebbero". 

Le fonti non c'entrano nulla e infatti vanno tutelate: non con una riga sopra. Tagli i documenti.

